  padding: 0px 0px 0px 0px;
  box-sizing: border-box;
`;
 
const Reservas = () => {
 
    return ( 
        <ReservasWrapper>
            <Layout title="La Rioja Turismo - Reservas">
                <h1> reservas</h1>
            </Layout>
        </ReservasWrapper>
     );
}
 
export default Reservas;
